import React from 'react'
import Select from "react-style";


const SelectComponent = ({optionData}) => {
    var options = [{
        value: "Select",
        label: "Select"
    }]
  return (
    <Select onChange={(e)=>{console.log(e.value)}} options={options}/>
  )
}

export default SelectComponent
